import React from 'react'
import allBlogs from '../Components/allBlogs';

function BlogsPage() {
    return (
        <div className="BlogsPage">
            {
                allBlogs.map((blog) => {
                    return <div className="blog" key={BlogsPage.id}>

                    </div>
                })
            }
        </div>
    )
}

export default BlogsPage
